INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24001, 0.0, "2030/12/17 14:59:59", 0.0, 0.0, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 102301, 24, 401, "2020/07/31 12:00:00", "アヤネ", 2, 10046, 2);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24002, 2.21, "2030/12/17 14:59:59", 0.0, 0.0, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 102301, 24, 402, "2020/07/31 12:00:00", "アヤネ", 2, 10046, 1);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24003, 0.0, "2030/12/17 14:59:59", 0.0, 0.0, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 102301, 24, 403, "2020/07/31 12:00:00", "アヤネ", 2, 10046, 2);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24004, 1.99, "2030/12/17 14:59:59", 0.0, 0.0, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 192201, 24, 701, "2020/07/31 12:00:00", "アサヒ", 1, 10046, 2);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24005, 2.21, "2030/12/17 14:59:59", 0.0, 0.0, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 192201, 24, 702, "2020/07/31 12:00:00", "アサヒ", 2, 10046, 1);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24006, 3.33, "2030/12/17 14:59:59", 0.0, 0.0, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 192201, 24, 703, "2020/07/31 12:00:00", "アサヒ", 1, 10046, 2);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24007, 0.0, "2030/12/17 14:59:59", 0.0, 0.0, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 192301, 24, 801, "2020/07/31 12:00:00", "部員３", 2, 10046, 2);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24008, 2.68, "2030/12/17 14:59:59", 0.0, 0.0, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 192301, 24, 802, "2020/07/31 12:00:00", "部員３", 2, 10046, 1);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24009, 0.0, "2030/12/17 14:59:59", 0.0, 0.0, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 192301, 24, 803, "2020/07/31 12:00:00", "部員３", 2, 10046, 2);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24010, 0.0, "2030/12/17 14:59:59", 0.0, 0.0, "やった！", 192501, 24, 501, "2020/07/31 12:00:00", "", 1, 10046, 1);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24011, 0.0, "2030/12/17 14:59:59", 0.0, 0.0, "勝ったよ！", 192501, 24, 502, "2020/07/31 12:00:00", "", 1, 10046, 1);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24012, 0.0, "2030/12/17 14:59:59", 0.0, 0.0, "いい調子！", 192501, 24, 503, "2020/07/31 12:00:00", "", 1, 10046, 1);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24013, 5.33, "2030/12/17 14:59:59", 0.0, 0.0, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 113501, 24, 111, "2020/07/31 12:00:00", "ミサト", 2, 10046, 6);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24014, 6.85, "2030/12/17 14:59:59", 0.0, 0.0, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 113501, 24, 112, "2020/07/31 12:00:00", "ミサト", 2, 10046, 1);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24015, 3.0, "2030/12/17 14:59:59", 0.0, 0.0, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 113501, 24, 113, "2020/07/31 12:00:00", "ミサト", 2, 10046, 1);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24016, 6.11, "2030/12/17 14:59:59", 0.0, 0.0, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 192401, 24, 611, "2020/07/31 12:00:00", "ダイチ", 2, 10046, 1);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24017, 6.75, "2030/12/17 14:59:59", 0.0, 0.0, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 192401, 24, 612, "2020/07/31 12:00:00", "ダイチ", 2, 10046, 1);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24018, 0.0, "2030/12/17 14:59:59", 0.0, 0.0, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 192401, 24, 613, "2020/07/31 12:00:00", "ダイチ", 2, 10046, 2);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24019, 4.52, "2030/12/17 14:59:59", 0.0, 0.0, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 113401, 24, 211, "2020/07/31 12:00:00", "ハツネ", 1, 10046, 2);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24020, 3.89, "2030/12/17 14:59:59", 0.0, 0.0, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 113401, 24, 212, "2020/07/31 12:00:00", "ハツネ", 1, 10046, 2);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24021, 13.49, "2030/12/17 14:59:59", 0.0, 0.0, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 113401, 24, 213, "2020/07/31 12:00:00", "ハツネ", 2, 10046, 1);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24022, 3.17, "2030/12/17 14:59:59", 0.0, 0.0, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 106501, 24, 311, "2020/07/31 12:00:00", "カヤ", 2, 10046, 1);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24023, 4.42, "2030/12/17 14:59:59", 0.0, 0.0, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 106501, 24, 312, "2020/07/31 12:00:00", "カヤ", 2, 10046, 1);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24024, 2.89, "2030/12/17 14:59:59", 0.0, 0.0, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 106501, 24, 313, "2020/07/31 12:00:00", "カヤ", 1, 10046, 6);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24025, 3.71, "2030/12/17 14:59:59", 0.0, 0.0, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 102301, 24, 421, "2020/07/31 12:00:00", "アヤネ", 3, 10046, 4);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24026, 5.1, "2030/12/17 14:59:59", 0.0, 0.0, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 192201, 24, 721, "2020/07/31 12:00:00", "アサヒ", 1, 10046, 2);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24027, 4.34, "2030/12/17 14:59:59", 0.0, 0.0, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 192301, 24, 821, "2020/07/31 12:00:00", "部員３", 3, 10046, 1);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24028, 0.0, "2030/12/17 14:59:59", 0.0, 0.0, "いい勝負だったよ\nまたやろうね", 192501, 24, 521, "2020/07/31 12:00:00", "", 1, 10046, 1);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24029, 5.62, "2030/12/17 14:59:59", -360.0, 0.0, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 113501, 24, 101, "2020/07/31 12:00:00", "ミサト", 2, 10046, 1);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24030, 9.58, "2030/12/17 14:59:59", -360.0, 0.0, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 113501, 24, 102, "2020/07/31 12:00:00", "ミサト", 2, 10046, 1);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24031, 0.0, "2030/12/17 14:59:59", -360.0, 0.0, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 113501, 24, 103, "2020/07/31 12:00:00", "ミサト", 2, 10046, 2);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24032, 9.13, "2030/12/17 14:59:59", -360.0, 0.0, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 113501, 24, 104, "2020/07/31 12:00:00", "ミサト", 1, 10046, 2);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24033, 8.27, "2030/12/17 14:59:59", -360.0, 0.0, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 113501, 24, 105, "2020/07/31 12:00:00", "ミサト", 2, 10046, 1);
